import React, {Fragment} from 'react';
import '@lottiefiles/lottie-player';
import * as LottiePlayer from "@lottiefiles/lottie-player";

import { withNamespaces } from 'react-i18next';

const FormComponent =({t}) => {
    return <Fragment>
        <div className="form">

            <form>
                <lottie-player src="https://assets5.lottiefiles.com/datafiles/zc3XRzudyWE36ZBJr7PIkkqq0PFIrIBgp4ojqShI/newAnimation.json"  background="transparent"  speed="1"  style="width: 300px; height: 300px;"  loop controls autoplay></lottie-player>
                <input type="text" placeholder="&#xf007;  username"/>
                <input type="password" id="password" placeholder="&#xf023;  password"/>
                <i className="fas fa-eye" onClick="show()"></i>
                        <button>LOGIN</button>
                        <p className="message"/>
            </form>

            <form className="login-form">
                <button type="button" onClick="window.location.href='signup.html'">SIGN UP</button>
            </form>
        </div>
    </Fragment>
}

export default withNamespaces()(FormComponent);
